searchBook.responseJavascript:
function functionName(config, params, obj)
{
	var result = {};

	if(obj.totalcount){
		result.total = obj.totalcount;
		result.success = true;
	}

	if(obj.nowpage && obj.totalpage)
	{
		if(obj.nowpage>=obj.totalpage)
			result.more=false;
		else
			result.more=true;
	}

	if(obj.items)
	{
		var list = [];
		var length = obj.items.length;
		for(let i=0; i<length; i++)
		{
			let book = {};
			let oldBook = obj.items[i];	
			book.bookId = oldBook.id;
			book.bookName = oldBook.title;
			book.desc = oldBook.intro;
			book.cover = oldBook.thumb;

			list.push(book);
		}
		result.list = list;
	}

	return result;
}

