function functionName(config, params, result) {
    let list = [];
    result.data.books.forEach(x => {
        list.push({
            'bookName': x.name,
            'author': x.teller,
            'cover': 'https://pic.iiszg.com/' + x.pic,
            'desc': x.synopsis,
            'cat': x.type,
            'status': x.status,
            'detailUrl': 'https://apk-lb-json.fodexin.com/json/v1/cont/' + x.book_id + '.json',
        })
    })
    return { 'list': list };
}

