@js:

try {
    //params.nativeTool.logWithKey('', "ËøõÂÖ•");
    eval(config.httpHeaders['encryptCode']);
    //params.nativeTool.logWithKey('', "eval ÂÆåÊØï");
    let PUBLIC_KEY = config.httpHeaders['publickey'];
    //params.nativeTool.logWithKey(PUBLIC_KEY, "PUBLIC_KEY");
    let url = 'https://apk-lb-play.fodexin.com/?a=api';
    let res = result.match(/\d+/g);
    //params.nativeTool.logWithKey(res, "res");
    let encodeData = JSON.stringify({ "road": "play", "book_id": res[1], "play_id": res[0], "app_version": "1.1.2" });
    //params.nativeTool.logWithKey(encodeData, "encodeData");
    let crypt = new window_.JSEncrypt();
    //params.nativeTool.logWithKey('', "crypt");
    crypt.setPrivateKey(PUBLIC_KEY);
    encodeData = crypt.encrypt(encodeData);
    //params.nativeTool.logWithKey(encodeData, "encodeData");
    let httpParams = { 'param': encodeData };
    delete config.httpHeaders['publickey'];
    delete config.httpHeaders['encryptCode'];
    config.httpHeaders['Content-Type'] = 'application/x-www-form-urlencoded';
    config.httpHeaders['Referer'] = 'https://apk.jqkan.com/';
    config.httpHeaders['Accept'] = '*/*';
    config.httpHeaders['User-Agent'] = 'laobai_tv/1.1.2(Mozilla/5.0 (Linux; Android 10; MIX 2S Build/QKQ1.190828.002; wv) AppleWebKit/537.36 (KHTML, like Gecko) Version/4.0 Chrome/98.0.4758.101 Mobile Safari/537.36)'
    return {
        'url': url,
        'POST': true,
        'httpHeaders': config.httpHeaders,
        'httpParams': httpParams,
    }


} catch (error) {
    params.nativeTool.logWithKey(error.message, "error");

}

